import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var StopCircle = createReactComponent("StopCircle", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["rect", {
  x: "9",
  y: "9",
  width: "6",
  height: "6",
  key: "bgbeli"
}]]]);
export default StopCircle;
